// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

contract ADDRESS {
    function getBalance(address _a) public view returns(uint) {
        return _a.balance;
    }

    function getCode(address _a) public view returns(bytes memory) {
        return _a.code;
    }
}

